package com.juanantonio.recordador;

import com.juanantonio.recordador.model.PersonEntity;

import org.junit.Before;
import org.junit.Test;

import static org.junit.Assert.*;

/**
 * Example local unit test, which will execute on the development machine (host).
 *
 * @see <a href="http://d.android.com/tools/testing">Testing documentation</a>
 */

public class UnitTest {
    PersonEntity p;

    @Before
    public void setUp() {
        this.p = new PersonEntity();
    }

    @Test
    public void testName(){
        assertEquals(true, this.p.setName("Juan"));
        assertEquals(false, this.p.setName("P"));
        assertEquals("Juan", this.p.getName());
        assertNotEquals("Pepe",p.getName());

    }

    @Test
    public void testEmail(){
        assertEquals(true, p.setEmail("test@test.com"));
        assertEquals(false, p.setEmail("test@testcom"));
        assertEquals("test@test.com", p.getEmail());
        assertNotEquals("test@testcom", p.getEmail());
    }


    @Test
    public void testDate(){
        assertEquals(true, p.setDate("28/02/2020"));
        assertEquals(false, p.setDate("29/02/2019"));
        assertEquals("28/02/2020", p.getDate());
        assertNotEquals("29/02/2020", p.getDate());
    }


    @Test
    public void testLocation(){
        assertEquals(true, p.setLocation("Aguilar"));
        assertNotEquals(true, p.setLocation("L"));
        assertEquals("Aguilar", p.getLocation());
        assertNotEquals("Lucena",p.getLocation());
    }

    @Test
    public void testProvince(){
        assertEquals(true, p.setProvince("Córdoba"));
        assertNotEquals(true, p.setProvince("P"));
        assertEquals("Córdoba", p.getProvince());
        assertNotEquals("Malaga",p.getProvince());
    }

    @Test
    public void testState(){
        p.setState(true);
        assertEquals(true, p.getState());
        assertNotEquals(false, p.getState());
    }

    @Test
    public void testImage(){
        p.setImage("");
        assertEquals(p.getImage(), "");
        assertNotEquals(p.getImage(), "TEST------");
    }

    @Test
    public void testId() {
        p.setId(1);
        assertEquals("1", p.getId().toString());
    }
}